import React from 'react'
import axios from 'axios'

const Main = () => {
    let cases;
    axios.get('https://api.covid19india.org/data.json')
        .then(function (response) {
            cases = response.data.statewise[0].confirmed
            console.log(response)
        })
        .catch(function (error) {
            console.log(error);
        })
    console.log(cases)
    return (
        <>
            <h1>Total Cases</h1>
            <h2>{cases}</h2>
        </>
    )
}

export default Main
